'9333': "\u0412\u0430\u043D\u0442\u0430\u0436\u043D\u0438\u043A\u0438"
'94': "\u041D\u0430\u0439\u043F\u0440\u043E\u0441\u0442\u0456\u0448\u0456 \u043F\u0440\u043E\u0444\u0435\u0441\u0456\u0457, \u0449\u043E \u0454 \u0437\u0430\u0433\u0430\u043B\u044C\u043D\u0438\u043C\u0438 \u0434\u043B\u044F \u0432\u0441\u0456\u0445 \u0433\u0430\u043B\u0443\u0437\u0435\u0439 \u0435\u043A\u043E\u043D\u043E\u043C\u0456\u043A\u0438"
'941': "\u041A\u043E\u043C\u0456\u0440\u043D\u0438\u043A\u0438 \u0442\u0430 \u0432\u0430\u0433\u0430\u0440\u0456"
